import React from 'react';
import ItemDescription from './ItemDescription';

function Product(props) {
    return (
        <div>
            <h1>{props.name}</h1>
            <h2>{props.description}</h2>
            <h2>${props.price}</h2>

            <ItemDescription name={props.name} desc />
        </div>
    )
};

export default Product;
